def find_taro_walk_destination(h, w, n, grid):
    dp = [[0] * w for _ in range(h)]
    dp[0][0] = n + 1
    for i in range(h):
        for j in range(w):
            if i < h - 1 and grid[i][j] == 0:
                dp[i + 1][j] += (dp[i][j] + 1) // 2
            if i < h - 1 and grid[i][j] == 1:
                dp[i + 1][j] += dp[i][j] // 2
            if j < w - 1 and grid[i][j] == 0:
                dp[i][j + 1] += dp[i][j] // 2
            if j < w - 1 and grid[i][j] == 1:
                dp[i][j + 1] += (dp[i][j] + 1) // 2
    for i in range(h):
        for j in range(w):
            grid[i][j] = (grid[i][j] + dp[i][j]) % 2
    (i, j) = (0, 0)
    while i < h and j < w:
        if grid[i][j] == 0:
            i += 1
        else:
            j += 1
    return (i + 1, j + 1)

